;; **
;;; Recalling the formula for variance of @@\mathbb{V}[x] = \mathbb{E}[x^2] - \mathbb{E}[x]^2@@, estimate @@\mu, \sigma@@:
;; **

;; @@
(def hat-x (reduce + (map (fn [w x] (* w x)) normalized-weights proposal-samples)))
(def hat-x-squared (reduce + (map (fn [w x] (* w (* x x))) normalized-weights proposal-samples)))

(println "estimate of mu:" hat-x)
(println "estimate of sigma:" (Math/sqrt (- hat-x-squared (* hat-x hat-x))))
